The Rocky Horror Picture Show is a 1975 British musical comedy film that parodies science fiction and horror films. Still in limited release nearly 34 years after its premiere, it has the longest-running theatrical release in film history. It gained notoriety as a midnight movie in 1977 when audiences began participating with the film in theaters across the United States. &quot;Rocky Horror&quot; is the first movie from a major film studio, such as 20th Century Fox, to be in the midnight movie market. Widely known by mainstream audiences, it has a large international following and is one of the most well known and financially successful midnight movies of all time. In 2005, the film was selected for preservation in the United States National Film Registry by the Library of Congress as being &quot;culturally, historically, or aesthetically significant.&quot;

The film, considered a cult classic, is an adaptation of the British musical stage production The Rocky Horror Show. Richard O'Brien, author of the stage show, was assisted by Jim Sharman in writing the screenplay. The movie introduces Tim Curry and features Susan Sarandon and Barry Bostwick along with cast members from the original Kings Road production of the play performed at the Royal Court Theatre.
